const getItem = function (layout, temp = null) {
  let item = "HELLOBAR";
  if (layout == 1) item = "HELLOBAR_TIMER";
  if (layout == 2) item = "EXIT_INTENT";
  if (layout == 3) item = "CENTRAL_TIMER";
  if (layout == 4) item = "DYNAMIC_ELEMENT";
  if (layout == 5) item = "HELLOBAR_WITH_OPTIN";
  if (layout == 6) item = "HELLOBAR_TIMER_WITH_OPTIN";
  if (layout == 7) item = "EXIT_INTENT_WITH_OPTIN";
  if (!temp && temp != 0) {
    return template[item];
  } else {
    return template[item][temp];
  }
};
module.exports = getItem;
